  &__info,
  &__subscribe {
    width: 260px;
  }

  &__info p {
    margin-top: 20px;
  }

  &__widgets {
    border-top: 1px solid $color-ds25;
    margin-top: 100px;
  }

  &__widgets div {
    justify-content: space-between;
  }

  &__social {
    display: flex;
    justify-content: center;
    padding: 24px 0;
    margin: 0;
  }

  &__twitter,
  &__facebook,
  &__instagram {
    display: inline-block;
    width: 22px;
    height: 22px;
    background-repeat: no-repeat;
    background-position: center center;
  }

  &__item {
    margin-left: 20px;
    list-style-type: none;
  }

  &__twitter {
    background-image: url(../img/twitter.svg);
  }

  &__facebook {
    background-image: url(../img/facebook.svg);
  }

  &__instagram {
    background-image: url(../img/instagram.svg);
  }
}
